		<title>mi annoio</title>
		<meta charset="utf-8">
		<meta name="viewport" content="width=device-width, initial-scale=1.0">
		<style>
			:root {
				--adjust-raccoon: skew(-4deg);
				--box-size: 400px;
			}

			html, body {
				background-color: #222;
				padding: 0;
				margin: 0;
				width: 100%;
				height: 100%;
			}
			#box {
				background-color: #fff;
				width: var(--box-size);
				height: var(--box-size);
				border-radius: calc(var(--box-size) / 2);
				position: fixed;
				top: calc(50% - var(--box-size) / 2);
				left: calc(50% - var(--box-size) / 2);
				overflow: hidden;
				animation: rotate 15s forwards infinite;
			}

			#box img {
				width: 100%;
				animation: bounce 0.5s forwards infinite;
				transform: var(--adjust-raccoon) translate(5px, 10px);
			}

			@keyframes rotate {
				from {
					transform: rotate(0deg);
				}

				to {
					transform: rotate(360deg);
				}
			}

			@keyframes bounce {
				0% {
					transform: var(--adjust-raccoon) translate(5px, 10px);
				}

				50% {
					transform: var(--adjust-raccoon) translate(-4px, 0px);
				}

				100% {
					transform: var(--adjust-raccoon) translate(5px, 10px);
				}
			}
		</style>
